import React, { useEffect, useState } from 'react';
import { Link } from "react-router-dom";


//"How it works" in Home Component
const Profiles = () => {
    const [profiles, setProfiles] = useState({
        key_name: "charles",
        profile_image: "",
        full_name: "Lars",
        profession: "Developer",
        price: 3
      })

    const RenderProfiles = (props) => {
        const { profile } = props;

        return (
            <>
              <div className="new-profile-video-wrapper margin-card">
                <Link to={{pathname: `profiles/${profile.key_name}`}}>
                  <div className="img-wrapper">
                    <img className="profile-img" src={profile.profile_image} />
                    <div className="new-profile-bottom-label">
                      <div className="bottom-label-inner">
                        <span className="first-row">
                          <p>{profile.full_name}</p>
                        </span>
                        <span className="second-row">
                          <p>{profile.profession}</p>
                          <p>â‚¬{profile.price}</p>
                        </span>
                      </div>
                    </div>
                  </div>
                </Link>
              </div>
            </>
          )
    }

    console.log(profiles.length);

    return (
        <div className="profiles-cont">
          <div className="start-body-wrapper scroll-row">
            <h1 className="h1-title new-profiles-title">
              Current Profiles
            </h1>
            <div className="start-body-inner">
              {profiles.length > 0 && profiles.sort((a, b) => b.id - a.id).map((row, i) => <RenderProfiles key={i} profile={row} />)}
            </div>
          </div>
        </div>
    );
}
export default Profiles;
